import React from 'react';
class Header extends React.Component{
    render(){
        return (
            <header className="top">
                <h1>Catch Of the Day</h1>
                <h3 className="tagline">
                <span>Frash Daily</span>
                </h3>
            </header>
            
            
        );
    }
}

export default Header;
